import React , {Component} from "react";
import {getMovies} from "../services/fakeMovieService";
class Movies extends Component {
    state = {
        movies : getMovies()
    }
    render(){
        
        return(

            <table className ="table">
                <thead>
                    <tr>
                        <th>Title</th>
                        <th>Genre</th>
                        <th>Stock</th>
                        <th>DailyRental</th>
                    </tr>
                </thead>
            </table>
        );
    }
}
export default Movies;
